 import React from 'react';
 import  { Toolbar, AppBar } from '@material-ui/core';
 import './App.css';

function App() {
  return (
   <React.Fragment>
   <div className="App">
   <header className="App-header">
   <AppBar position="fixed">
     <Toolbar>{
       <h1 className="Header">Test here</h1>

     }</Toolbar>
   </AppBar>
   </header>
 </div>
   </React.Fragment>
  )
}

export default App;

